import React from 'react';
import { Link } from 'react-router-dom';
import logoDark from '../../assets/img/uploads/2024/06/logo-dark.png';
import styles from './Header.module.css';

const Logo = () => {
  return (
    <div className={styles.logo}>
      <Link to="/" className={styles.secondaryLogo}>
        <img src={logoDark} alt="Logo" style={{ maxHeight: '30px' }} />
      </Link>
    </div>
  );
};

export default Logo;
